return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'sr','pot-creation-date'=>'2026-02-04 13:06-0600','po-revision-date'=>'2026-02-04 13:06-0600','translation-revision-date'=>'2026-02-04 13:06-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s је тренутно %2$sпаузиран%3$s и не приказује календаре на почетним страницама. Можете наставити приказивање календара на картици %4$sУслужни програми%5$s %6$sовде%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sПокрећете ICS календар у WordPress Playground имплементацији.%2$s Пошто је ICS календар намењен за покретање на веб серверу, неке функције могу бити недоступне или можда неће правилно функционисати.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sВаш сајт тренутно користи временску зону засновану на UTC помаку.%2$s Ово може довести до грешака у приказу времена у %3$s додатку на локацијама које поштују летње рачунање времена. Молимо вас да %4$sпромените подешавање временске зоне%5$s на град најближи вашој локацији, у истој временској зони, ради правилног приказа времена. Погледајте нашу %6$sдокументацију%7$s за додатне информације о овом проблему.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'Важно! Изгледа да ваша конфигурација %1$s прелази ограничења брзине добављача изворног календара.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Ако се ваши календари не учитавају исправно, прегледајте подешавања и коришћење %1$s:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Не користите %1$s у својим кратким кодовима. Ова функција је намењена само за решавање проблема и не би требало да буде трајно укључена.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Повећајте подешавање %1$s %2$sПривремени (кеш) рок трајања%3$s на %4$s43200%5$s (12 сати) или више, да бисте смањили учесталост захтева добављачу. (Погледајте напомену испод.)','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Избегавајте укључивање великог броја фидова (10 или више) од истог добављача у један %1$s кратки код.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Привремено паузирајте ICS календар на вашим предњим страницама помоћу услужног програма %1$sПаузирај календаре%2$s. (Препоручује се 24-48 сати.)','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s укључује уграђено кеширање, посебно ради побољшања перформанси и избегавања прекорачења ограничења брзине добављача. Заобилажење овог кеширања са веома ниским подешавањем %2$sпоновог учитавања%3$s може покренути привремену блокаду на IP адреси вашег веб сервера, или могуће на целој вашој мрежи за хостовање, од стране добављача календара.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Након што извршите препоручене измене, сачекајте до 24 сата да ваш добављач календара уклони све привремене блокаде са ваше IP адресе. Ако установите да проблем и даље постоји, користите наш %1$sобразац за захтев за подршку%2$s да бисте нас контактирали и обавезно приложите свој %3$sсистемски извештај%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Напомена: Подесите %1$sИстек привременог (кеш) рока трајања%2$s што је могуће већи, узимајући у обзир колико често се информације о догађајима у вашем календару обично ажурирају. %3$s Имајте на уму да можете користити услужни програм %4$sОбриши кеширане податке календара%5$s да бисте ручно обрисали кеш меморију у било ком тренутку, ако је потребно.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sНапомена:%2$s %3$s верзија 10.6 мења подразумеване опције за неколико подешавања кратких кодова. Ради одржавања доследности, ова нова подразумевана подешавања %4$sнису%5$s омогућена приликом надоградње са раније верзије. Ако желите да сазнате више о променама, прочитајте наш %6$sблог пост%7$s или, да бисте прешли на нова подразумевана подешавања, укључите опцију %8$s на страници %9$s подешавања%10$s.','Use new parameter defaults (v.10.6)'=>'Користите нове подразумеване вредности параметара (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sНапомена:%2$s %3$s верзија 11.0 поједностављује начин преузимања URL-ова ICS фида. Ова промена користи стандардну уграђену WordPress функцију, тако да би требало да буде потпуно компатибилна са свим постојећим инсталацијама. Ако наиђете на било какве нове проблеме након надоградње на верзију 11 или новију, посетите %4$sWordPress форуме за подршку%5$s за помоћ.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sНапомена:%2$s %3$s верзија 11.5.14.2 уводи нови, безбеднији метод за руковање параметрима календара приликом учитавања путем AJAX-а. Молимо вас да обришете све додатке за кеширање које користите како бисте осигурали да се ваши календари правилно учитавају помоћу новог метода.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sДобродошли у %2$s верзију 12!%3$s Верзија 12.0 уводи додатне алате за решавање проблема, плус бројна побољшања перформанси и усавршавања интерфејса. Више детаља о овом ажурирању потражите у %4$sдневнику промена%5$s.','Getting Started'=>'Почетак','Settings'=>'Подешавања','Appearance'=>'Изглед','Utilities'=>'Сервисне Информације','System Report'=>'Системски извештај','Support'=>'Подршка','Upgrade to %1$s!'=>'Надоградите на %1$s!','Show/hide all'=>'Прикажи/сакриј све','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'ICS датотека није могла бити преузета или је била празна. Молимо вас да проверите да ли је URL исправан и да ли је конфигурација ваше php.ini датотеке доступна. Ако користите размаке за разграничавање више URL адреса, можете покушати да користите и усправну црту. Погођена URL адреса:','Hide past events'=>'Сакриј прошле догађаје','Show past events'=>'Прикажи прошле догађаје','Contact:'=>'Контакт:','Resources:'=>'Ресурси:','Click for more...'=>'Кликните за више...','Save to your calendar'=>'Сачувај у календару','Cancelled'=>'Otkazana','The legacy parser option is deprecated and will be removed in a future update.'=>'Опција застарелих парсера је застарела и биће уклоњена у будућем ажурирању.','Print'=>'Штампај','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Атрибут кратког кода „currentweek“ је застарео. Уместо тога користите view="week" у свом кратком коду.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Атрибут кратког кода „legendinline“ је застарео. Уместо тога користите legendstyle="inline" у свом кратком коду.','%1$s has %2$sresumed%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s је %2$sнаставио/ла%3$s да приказује календаре на почетним страницама. Ако ваш сајт користи додатак за кеширање, можда ћете морати да обришете кеш меморију.','%1$s has %2$spaused%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s је %2$sпаузирао/паузирала%3$s приказивање календара на почетним страницама. Ако ваш сајт користи додатак за кеширање, можда ћете морати да обришете кеш меморију.','Cleared %1$s %2$s transient(s).'=>'Обрисано је %1$s %2$s пролазних појава.','No %1$s transients were found.'=>'Није пронађен ниједан пролазни процес (%1$s).','All saved ICS feed URLs have been cleared.'=>'Сви сачувани URL-ови ICS фида су обрисани.','All %1$s settings have been reset to defaults, and saved ICS feed URLs have been cleared.'=>'Сва подешавања за %1$s су враћена на подразумеване вредности, а сачувани URL-ови ICS фида су обрисани.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Изгледа да URL адреса вашег фида садржи акредитиве за основну HTTP аутентификацију. Покушајте да искључите опцију %1$s на картици %2$s изнад.','Use legacy feed request method'=>'Користи стари метод захтева за фид','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sОва URL адреса указује на датотеку у вашој медијској библиотеци.%2$s Иако би требало да можете да користите ову URL адресу у кратком коду %3$s, она ће бити статички снимак календара у време када је датотека креирана и неће одражавати будућа ажурирања изворног календара. Погледајте наш %4$sУпутство за кориснике%5$s за упутства о добијању исправне динамичке URL адресе фида.','Error: Could not resolve IP address for %1$s.'=>'Грешка: Није могуће решити IP адресу за %1$s.','Resolved IP address for %1$s:'=>'Решена IP адреса за %1$s:','%1$sAppearance updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sИзглед је ажуриран.%2$s Можда ћете морати да освежите страницу да бисте видели неке промене.','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Текст унет у поље „Подразумевани кратки код“ није важећи кратки код и није сачуван.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sПодешавања су ажурирана.%2$s Можда ћете морати да освежите страницу да бисте видели неке промене.','calendar event'=>'догађај у календару','Event download failed.'=>'Преузимање догађаја није успело.','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Метода захтева за стари фид је застарела и биће уклоњена у блиској будућности. Тестирајте своје фидове са искљученом методом захтева за стари фид.','Future updates of %1$s will require WordPress 5.3 or newer. Please update your site to a newer version of WordPress as soon as possible.'=>'Будућа ажурирања сајта %1$s захтеваће WordPress 5.3 или новији. Молимо вас да што пре ажурирате свој сајт на новију верзију WordPress-а.','An error occurred with %1$s while attempting to copy language translation files. The required PHP filesystem function %2$s is unavailable. This is required to address a conflict with certain translation customization plugins such as %3$s. As a result, %1$s translations may not load properly while the conflicting translation plugin is active.'=>'Дошло је до грешке са %1$s приликом покушаја копирања датотека за превод језика. Потребна функција PHP фајл система %2$s није доступна. Ово је потребно да би се решио сукоб са одређеним додацима за прилагођавање превода као што је %3$s. Као резултат тога, преводи %1$s се можда неће правилно учитати док је активан сукобљени додатак за превод.','Map'=>'Mapa','Recurring event'=>'Понављајући догађај','Recurs every %1$s years'=>'Понавља се сваких %1$s година','Recurs yearly'=>'Понавља се годишње','Recurs every %1$s months'=>'Понавља се сваких %1$s месеци','Recurs monthly'=>'Понавља се месечно','Recurs every %1$s weeks'=>'Понавља се сваких %1$s недеља','Recurs weekly'=>'Понавља се недељно','Recurs every %1$s days'=>'Понавља се сваких %1$s дана','Recurs daily'=>'Понавља се свакодневно','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Изгледа да својство „url“ у вашем кратком коду %1$s садржи HTML ознаке; највероватније је ваш URL претворен у везу на коју се може кликнути. Због тога се ваш календар можда неће правилно приказивати. Уклоните везу на коју се може кликнути из кратког кода.','The r34ics_url_get_contents() function is no longer supported.'=>'Функција r34ics_url_get_contents() више није подржана.','Add %1$s'=>'Додај %1$s','Close'=>'Затвори','ICS Feed URL:'=>'URL ICS фида:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Уверите се да користите URL адресу за %1$sпретплату%2$s, а не URL адресу за %3$sвеб преглед%4$s.%5$s (Уношењем URL адресе директно у веб прегледач требало би да се преузме %6$s датотека.)','Calendar Title:'=>'Наслов календара:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Оставите празно да бисте користили подразумевани наслов календара. Унесите %1$s да бисте потпуно изоставили наслов.','Calendar Description:'=>'Опис календара:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Оставите празно да бисте користили подразумевани опис календара. Унесите %1$s да бисте потпуно изоставили опис.','View:'=>'Приказ:','month'=>'mesec','list'=>'листа','week'=>'sedmica','Count:'=>'Број:','Format:'=>'Формат:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Оставите поље %1$s празно да бисте укључили све предстојеће догађаје. %2$s мора бити стандардни %3$sPHP формат датума%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Прикажи описе догађаја %1$s(промени на број у уметнутом кратком коду да би се подесило ограничење броја речи)%2$s','Show event locations %1$s(if available)%2$s'=>'Прикажи локације догађаја %1$s(ако су доступне)%2$s','Show event organizers %1$s(if available)%2$s'=>'Прикажи организаторе догађаја %1$s(ако су доступни)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sНапомена:%2$s Додатне %3$sопције приказа%4$s су доступне ручним уређивањем кратког кода након уметања.','Insert %1$s'=>'Уметни %1$s','Do even more with %1$s version 6!'=>'Урадите још више са %1$s верзијом 6!','Calendar Builder + Block Editor'=>'Креатор календара + Уређивач блокова','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Конфигуришите сва подешавања календара помоћу једноставног визуелног интерфејса и користите нови блок %1$s да бисте изабрали сачуване календаре из падајућег менија у уређивачу блокова, без потребе за кратким кодом! %2$sСазнајте више...%3$s','Additional Views and Enhanced Features'=>'Додатни прикази и побољшане функције','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s нуди много нових начина за приказивање календара, укључујући интеграције са популарним библиотекама отвореног кода %2$s и %3$s. Месечни и годишњи прикази са бочном траком за изабрани дан. „Следеће“ одлично функционише за распореде радио или ТВ станица. Виџет и доступност по години су савршени за резервације празника. Поред тога, додатне могућности су додате основним приказима Месечни, Основни, Листа и Недеља. %4$sПогледајте примере календара...%5$s','Customization'=>'Podešavanje','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Једноставни алати за потпуно прилагођавање боја, типографије и још много тога у вашем календару. Изаберите једну од наших унапред подешених палета боја или креирајте своју, са опцијама за појединачно прилагођавање боје сваког елемента у распореду календара. Изаберите између фонтова ваше теме, системских фонтова или више од 20 укључених фонтова отвореног кода. %1$sСазнајте више...%2$s','ICS Events'=>'ICS догађаји','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Претвара %1$s у комплетан систем за управљање календаром. Креирајте и уређујте нове догађаје директно у WordPress-у, па чак и да их беспрекорно интегришете са постојећим екстерним ICS фидовима. %2$sСазнајте више...%3$s','Localized Admin Interface'=>'Локализовани администраторски интерфејс','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Све администраторске странице за %1$s су преведене на десетине језика, укључујући енглески, чешки, дански, немачки, грчки, шпански, естонски, фински, француски, мађарски, италијански, јапански, корејски, литвански, летонски, норвешки, холандски, пољски, португалски, румунски, руски, словачки, српски, шведски, турски, украјински и кинески.','Visit %1$s to learn more.'=>'Посетите %1$s да бисте сазнали више.','Calendar Builder screenshot'=>'Снимак екрана програма „Креатор календара“','Appearance screenshot'=>'Снимак екрана изгледа','Available now!'=>'Доступно одмах!','Get %1$s!'=>'Добијте %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'Широка палета боја и опције типографије су доступне уз %1$s. %2$sСазнајте више%3$s','Color Palette'=>'Палета боја','Match calendar color palette to current Block Theme colors'=>'Ускладите палету боја календара са тренутним бојама блок теме','beta'=>'бета','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Замењује подразумевану неутралну палету боја %1$s најближим подударањима из тренутне палете боја Site Editor Styles или %2$s датотеке у вашој теми. Избор боја је алгоритамски и неке комбинације можда неће проћи тестове контраста приступачности. Ово подешавање нема ефекта ако користите „класичну“ тему која не укључује %3$s датотеку.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sОво је тренутно бета функција.%2$s Можда ће бити потребно извршити нека прилагођавања изгледа вашег календара или CSS-а за оптималан приказ, посебно ако сте своје фидове означили бојама. Функционалност се може променити.','Dark mode'=>'Тамни режим','Inverts color palette (light colors on a dark background).'=>'Инвертира палету боја (светле боје на тамној позадини).','Save Changes'=>'Сачувај промене','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Хвала вам што сте инсталирали %1$s. Пре него што креирате свој први кратки код календара, посетите страницу %2$sОпшта подешавања%3$s и проверите да ли су подешавања за језик сајта, временску зону и формат датума/времена исправна. Више информација потражите у нашем %4$sУпутству за кориснике%5$s.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Почните са %1$s у четири једноставна корака... и већ сте завршили први корак! Погледајте наш %2$sВодич за брзи почетак%3$s за остало.','Quick Start Guide'=>'Водич за брзи почетак','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Опсежан %1$sУпутство за кориснике%2$s је доступно на нашој веб страници. У наставку су неке брзе везе до кључних ресурса у документацији.','General:'=>'Опште:','General WordPress Settings'=>'Општа подешавања WordPress-а','%1$s Settings'=>'%1$s Подешавања','Working with Shortcodes:'=>'Рад са кратким кодовима:','Shortcode Overview'=>'Преглед кратког кода','Shortcode Builder'=>'Креатор кратких кодова','Shortcode Parameters Reference'=>'Референца параметара кратког кода','Advanced Topics:'=>'Напредне теме:','FAQs and Tips'=>'Честа питања и савети','CSS Guide'=>'CSS водич','Developer Resources'=>'Ресурси за програмере','GDPR'=>'Општа уредба о заштити података (GDPR)','Loading'=>'Učitavanje','Always use AJAX to render calendars'=>'Увек користите AJAX за приказивање календара','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'Учитавање AJAX-а је сада аутоматско. Можете поништити AJAX, ако је потребно, додавањем %1$s вашем кратком коду.','Increase memory limit when rendering calendars'=>'Повећајте ограничење меморије приликом рендеровања календара','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Ако се ваш календар не учитава и приказује фаталну грешку „недостаје меморије“, покушајте да повећате ограничење меморије. Препоручује се минимум од 512 MB. %1$s Напомене: 1) Неки добављачи хостинга можда не дозвољавају апликацијама да замене подразумевано подешавање сервера. 2) Није могуће подесити ову опцију на вредност нижу од тренутног подразумеваног ограничења меморије на вашем серверу.','deprecated'=>'застарело','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Неки сервери можда не подржавају подразумевани метод захтева за фид. Ако се ваши фидови не учитавају, укључите ову опцију да бисте користили стари метод захтева. Ова функција је застарела и биће уклоњена у будућем ажурирању.','Default shortcode'=>'Подразумевани кратки код','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Ако ће ваш сајт садржати велики број слично конфигурисаних кратких кодова календара, овде можете унети подразумевани „основни“ кратки код са параметрима који би требало да буду исти за све календаре. Појединачни кратки кодови на сајту тада могу да садрже само параметре који су јединствени за тај календар, као што је приказано: %1$s Сви параметри укључени у појединачни кратки код ће заменити оно што је овде подешено.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Дозволите приступ овим именима хостова која се решавају као резервисане IP адресе','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Ако се ваш календарски сервер налази на истом физичком серверу као и ваша веб локација, део је исте локалне мреже или на други начин користи %1$sрезервисану IP адресу%2$s, унесите његово име хоста овде да бисте омогућили приступ. За више календарских сервера, унесите једно име хоста у сваки ред. Више информација потражите у %3$s%4$s документацији%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Унесите по једно име хоста у сваки ред. Имена хостова су основно име домена, а не пуна URL адреса. %1$s На пример, унели бисте %2$s, а не %3$s.','Allow access to these ports'=>'Дозволите приступ овим портовима','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress аутоматски дозвољава приступ портовима 80, 443 и 8080. Ако вам је потребан приступ изворним календарима који користе нестандардне портове, унесите бројеве портова овде, одвојене зарезима.','Caching'=>'Кеширање','Transient (cache) expiration'=>'Привремени (кеш) истек','seconds'=>'sekundi','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Подешава колико дуго подаци календарског фида треба да буду кеширани на серверу (пролазне појаве WordPress-а) пре поновног учитавања. Подразумевана вредност је 3600 (1 сат). Минимална дозвољена вредност је 120 (2 минута).','Admin'=>'админ','Minimum access role'=>'Минимална улога приступа','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Идентификује минималну корисничку улогу којој је дозвољен приступ администраторским страницама %1$s. Одређене области, као што су Подешавања, додатно су ограничене само на %2$s кориснике (%3$s корисника на конфигурацијама са више локација).','Register Customizer'=>'Региструјте се као прилагођавач','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress више не укључује везу до алатке за прилагођавање у менију Изглед када је активна блок тема. Означите ову кућицу ако желите да користите алатку за прилагођавање, нпр. за додатни CSS унос. Напомена: Неке теме или додаци могу већ регистровати алатку за прилагођавање, у ком случају ово подешавање неће имати ефекта. (Поље за потврду омогућава алатку за прилагођавање само када је означено; не онемогућава га када није означено.)','Remove "Add ICS Calendar" button in Classic Editor'=>'Уклоните дугме „Додај ICS календар“ у класичном уређивачу','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Подразумевано, ICS календар додаје дугме „Додај ICS календар“ на траку са алаткама изнад WYSIWYG уређивача када се користи Класични уређивач. Означите ову кућицу да бисте уклонили дугме. Нема утицаја на сајтове који користе Блок уређивач (Гутенберг).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s верзија 10.6 је увела нове подразумеване вредности за неколико параметара кратких кодова. Нове инсталације аутоматски користе нове подразумеване вредности, али надограђене инсталације ће наставити да користе старе подразумеване вредности, осим ако ова кућица није означена. Више о овим променама прочитајте на %2$sнашем блогу%3$s.','User Guide'=>'Упутство за кориснике','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Наше комплетно упутство за употребу је доступно са комплетним преводом на десетине језика на нашој веб страници:','For assistance, please use our %1$ssupport request form%2$s.'=>'За помоћ, користите наш %1$sобразац за захтев за подршку%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Када контактирате подршку, приложите %1$sсистемски извештај%2$s са ове странице.','Spread the word!'=>'Проширите вест!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Ако сматрате да је %1$s корисно, можете нам помоћи да подржимо наш континуирани раст и развој тако што ћете дати %2$sрецензију са пет звездица%3$s. Хвала вам!','Calendar Status: %1$sPaused%2$s'=>'Статус календара: %1$sПаузирано%2$s','Calendar Status: %1$sActive%2$s'=>'Статус календара: %1$sАктиван%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Користите дугме за паузу ако треба привремено да искључите %1$s на вашим почетним страницама.','Resume Calendars'=>'Календари за животописе','Pause Calendars'=>'Паузирај календаре','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Садржај неће бити измењен, али ће ваши календари бити скривени и ниједна %1$s датотека (JavaScript, CSS) неће бити учитана на предњим страницама. Ако користите кеширање путем додатка или преко вашег провајдера хостинга, можда ћете морати да обришете кеш меморију након промене овог подешавања.','%1$s Data Cache'=>'%1$s Кеш података','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Ово ће одмах обрисати све постојеће кеширане податке календара (очистити пролазне податке), приморавајући WordPress да поново учита све календаре следећи пут када се прегледају. Кеширање ће се затим наставити као и раније.','Clear Cached Calendar Data'=>'Обриши кеширане податке календара','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Ако користите додатак за кеширање треће стране, можда ћете морати да обришете кеш меморију целог сајта након покретања овог услужног програма.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Да ли сте сигурни? Ово ће ресетовати сва подешавања за %1$s на подразумеване вредности. Ваше сачуване конфигурације календара и кратки кодови ће бити задржани, али ресетовање подразумеваних вредности може променити изглед ваших календара. Ако користите додатак за кеширање треће стране, можда ћете морати да обришете кеш меморију целог сајта након покретања овог услужног програма.','Only clear transients (default)'=>'Обриши само транзијенте (подразумевано)','Also clear all saved ICS feed URLs'=>'Такође обриши све сачуване URL-ове ICS фида','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Ресетуј %1$sсва%2$s %3$s подешавања (укључујући пролазне појаве и URL-ове фидова)','Last cleared:'=>'Последње обрисано:','never'=>'hикад','ICS Feed URL Tester'=>'Тестер URL-ова ICS фида','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Ако сте забринути да додатак не преузима правилно ваш фид, можете тестирати URL овде.','Enter feed URL...'=>'Унесите URL фида...','Test URL'=>'Тест URL','Results:'=>'Резултати:','%1$s received.'=>'Примљено је %1$s.','This appears to be a valid ICS feed URL.'=>'Изгледа да је ово важећи URL ICS фида.','unknown'=>'nepoznato','This does not appear to be a valid ICS feed URL.'=>'Изгледа да ово није важећи URL ICS фида.','Could not retrieve data from the requested URL.'=>'Није могуће преузети податке са тражене URL адресе.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Дошло је до непознате грешке при покушају преузимања тражене URL адресе.','Please copy the following text and include it in your message when emailing support.'=>'Молимо вас да копирате следећи текст и укључите га у своју поруку када шаљете имејл подршци.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Такође, молимо вас да унесете кратки код %1$s тачно онако како сте га унели на дотичној страници.','No events found.'=>'Није пронађен ниједан догађај.','Previous Page'=>'Претходна страница','Next Page'=>'Следећа страна','All Day'=>'Читав дан','Previous Month'=>'Претходни месец','Next Month'=>'Datum isteka ','Today'=>'Danas','Month selection'=>'Избор месеца','No events.'=>'Нема догађаја.','No additional events this month.'=>'Нема додатних догађаја овог месеца.','Week selection'=>'Избор недеље','Last week'=>'Последња недеља','This week'=>'Ove nedelje','Next week'=>'Следеће недеље','ICS Calendar'=>'ICS календар','https://icscalendar.com'=>'хттпс://ицсцалендар.цом','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Претворите свој Google календар, Microsoft Office 365 или Apple iCloud календар у беспрекорно интегрисано, аутоматски ажурирајуће WordPress искуство без потребе за одржавањем.','Room 34 Creative Services, LLC'=>'Соба 34 Креативне услуге, ДОО']];
